            <section>
                <Header/>
                    {/* <title>{title}</title> */}

                    {children}
                    <ul>
                        {diseases.map(disease => (
                            <li key={disease.id}>  
                                {disease.domain}
                            </li>
                        ))}
                    </ul>
                <Footer/>
            </section>
        );
    }
}

Layout.getInitialProps = async function() {
    const res = await fetch(DISEASE_LIST_API);
    const data = await res.json();

    console.log('Show data:',data);

    return {
        diseases: data.results
    };
};


export default Layout
